@Controller
@RequestMapping("/aPcb")
public class APcbController {

    @Autowired
    APcbService aPcbService;
    @GetMapping("barcode")
    public ModelAndView getBarcodeView(@RequestParam("aoiType")String aoiType){
        ConstController.constController.iniDefaultParamSetting();
        boolean bCmBoxs =false;// ConstPublicClassUtil.loadCmBoxs();bCmBoxs=true;
        try{
            int i = StringTimeUtils.getTimeStringToDate("2021-04-25 00:00:00").compareTo(new Date());
            if(i > 0  ){
                bCmBoxs = true;
            }else{
                bCmBoxs = false;
            };
        }catch (Exception e){
        }
        String viewName = "aoi/barcode_aoi";
        if(bCmBoxs){
        }else {
            viewName = "error/comBoxExpire";
        }
        ModelAndView mv = new ModelAndView(viewName);
        mv.addObject("weburl","/aPcb/barcode?aoiType="+aoiType+"&");
        mv.addObject("aoiType",aoiType);
        mv.addObject("hChartColor", ConstParam.DEFAULTSETTING_hChartColor);
        mv.addObject("backgroundColor",ConstParam.DEFAULTSETTING_backgroundColor);
        return  mv;

    }

    /***
     *  根据条码查询PCB信息
     * @param barcode
     * @return
     */
    @GetMapping("barcodeList")
    @ResponseBody
    public ApiResponse getBarcodeListJson(@RequestParam("barcode")String barcode,@RequestParam("aoiType")String aoiType){
        if(StringUtils.isEmpty(barcode)){
            return new ApiResponse(false,"Barcode_IS_NULL",null,null);
        }else{
            List<APcb> sPcbList = aPcbService.selectList(Condition.create()
                    .eq("aoiMode",aoiType)
                    .eq("boardBarcode",barcode).or().eq("aoiMode",aoiType).like("arrayInfo",barcode));

            if(sPcbList!=null && sPcbList.size()>0){
                StringBuilder sb = new StringBuilder();
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
                sb.append("");
               // String str = sb.toString();
                for (int i = 0; i < sPcbList.size(); i++) {

                    sPcbList.get(i).setRemark(sb.toString());

                }
                sb = null;
            }
            try{
                return new ApiResponse(true,null,null,sPcbList);
            }catch (Exception e){
            }finally {
                sPcbList=null;
                System.gc();
            }

        }
        return new ApiResponse(false,"Barcode_IS_NULL",null,null);
    }

}

